window.bookSummaryJSON = "<p>I finally know the truth of my identity: <i>I am not human. </i><br> <br> And it’s time I stop pretending that I am. <br> <br> If only I could control these rare, unique powers long enough to defeat my enemies.<br> <br> Because the fae gate is now open and the entire fae realm thinks <i>I’m</i> the villain.<br> <br> Or at least that's what I believed, until a fae prince gets down on one knee and offers his hand in marriage under the guise of court unity.</p> <p>Of course when my vampire boyfriend finds out, he has a proposal of his own. I love Bran and I do want to spend the rest of my life with him, but on <i>my</i> terms. <br> <br> I’m tired of being a pawn.<br> <br> It’s time I take charge of my own life and resume my rightful place on the Winter Court Throne. <br> <br> NOTE: Hot Vampire Next Door is a Kindle Vella serial, now in audio. This version is a boxset of season five and contains episodes 71-108. Season five is the final season.</p> <p>Check the author’s website for TWs.</p>"; 
